import React from "react";
import "../footer/FooterSecond.css";
import support3 from "../images/support3.svg";
import logoWhite from "../images/logoWhite.png";
import location from "../images/location.png";

const FooterSecond = () => {
  return (
    <div id="contact" className="row d-flex footerMainNew">
      <div className="col-3">Logo Fizmasoft</div>
      <div className="col-6">Sevrvices</div>
      <div className="col-3">Our Location</div>
    </div>
  );
};

export default FooterSecond;
